import React, { Component } from 'react'

 class Booklist extends Component {
    render() {
        return (
            <div className="book-list">
                <ul>
                    <li>The Kill List</li>
                    <li>The fault in our stars</li>
                    <li>the Day of  the Jackal</li>
                </ul>   
            </div>
        )
    }
}
export default Booklist
